import React from 'react';
import './styles.css';
import { ScrollingProvider, SectionLink, Section } from 'react-scroll-section';

export default function Home() {

    const indexImage = require('../../Assets/Images/index-image.jpg');
    const logo = require('../../Assets/Images/logo-in8-dev.svg');

    

    return (
        <div className="home-container">
            <div className="content">
                <img className="image-index" src={indexImage} alt=""/>
                <img className="logo-index" src={logo} alt=""/>
                <div className="home-title">
                    <div style={{fontSize: 72}}>ESTÁGIO</div> 
                    <div style={{fontSize: 32}}>PROVA DE SELEÇÃO</div>
                </div>
                <div>
                <SectionLink section="home">
                    
                    
                        Home
                    
                  
                </SectionLink>
                <SectionLink section="about">
                    {({ onClick, isSelected }) => (
                    <Item onClick={onClick} selected={isSelected}>
                        About
                    </Item>
                    )}
                </SectionLink>
                </div>
            </div>
        </div>
    );
}
